(57, 'Uttapam', 'Khana khazana', 30, 53, 'Uthappam is a type of dosa from South India. ... Unlike a typical dosa, which is crisp and crepe-like, uttapam is thicker, with toppings. The name is derived from the Tamil words Appam and Utthia or Uttria, meaning Poured-Appam.', '2 pcs', '250', 1, 1, 'product/thump_1620735698.jpg', 'product/0uttamapam 1.jpg', '2021-05-11 17:51:38', 4, 0),
